import Slide1 from "../Images/slide_1.png";
import Slide2 from "../Images/slide_2.png";
import Slide3 from "../Images/slide_3.png";

export const images = [
  { title: "San Diego", subtitle: "This is San Diego", img: Slide1 },
  {
    title: "Salvador, Brazil",
    subtitle: "The Best City in the World",
    img: Slide2,
  },
  {
    title: "UBC (Vancouver)",
    subtitle: "The University of British Columbia",
    img: Slide3,
  },
];
